$(function() {
	//===== Image fill block =====//
	function imgFill(el, pos) {
		$(el).each( function() {
			var path = $(this).find('img').attr('src');
			$(this).find('img').css({
				'opacity': '0'
			});
			$(this).css({
				'background-image': 'url(' + path + ')',
				'background-position': pos,
				'background-size': 'cover',
				'overflow': 'hidden'
			});
		});
	}
	imgFill('.img-fill', '50% 50%');

	//===== Mobile nav menu =====//
	$('a.toggle-menu').on('click', function(e) {
		e.preventDefault();
		$('.site-header').toggleClass('site_menu-on');
	});

	//===== Fixed header =====//
	function navFixed() {
		var nav = $('.site-header').outerHeight() + 320;
		var scr = $('html, body').scrollTop();

		if ( scr > nav ) {
			$('.site-header-top_m').addClass('fixed');
		} else {
			$('.site-header-top_m').removeClass('fixed');
		}
	}
	navFixed();

	//===== Popup =====//
	$('a[data-popup]').fancybox({
		src: $(this).attr('href'),
		defaultType: 'inline',
		lang: 'ru',
		i18n: {
			ru: {
				CLOSE: "Закрыть",
				NEXT: "Вперед",
				PREV: "Назад",
				ERROR: "Запрашиваемый контент не может быть загружен. <br/> Пожалуйста попробуйте позже.",
				PLAY_START: "Запустить слайдшоу",
				PLAY_STOP: "Остановить слайдшоу",
				FULL_SCREEN: "Полный экран",
				THUMBS: "Миниатюры",
				DOWNLOAD: "Скачать",
				SHARE: "Поделиться",
				ZOOM: "Масштаб"
			}
		}
	});

	//===== Resize & scroll window =====//
	$(window).on('scroll', function() {
		navFixed();
	});

	$(window).on('resize', function() {
		navFixed();
	});

	//===== Input mask =====//
	$('input[type="tel"]').inputmask({"mask": "+7 (999) 999-9999"});
});
